import React from "react";
import Avatar from "./Avatar";
import Detail from "./Detail";

function Card(props) {
    return (
        <div>
           
                <div className="term">
                <dt>
                    <span className="emoji" role="img" aria-label="Tense Biceps">
                    {props.emoji}
                    </span>
                    <span>{props.name}</span>
                </dt>
                <dd>
                    {props.meaning}
                </dd>
                </div>
                
        
        </div>
    )
}
export default Card;
